import "./MainNavigation.css";
function MainNavigation() {
  return (
    <nav>
      <button className="MainNavigation-Home">Home</button>
      <button className="MainNavigation-Home">Products</button>
      <button>Cart</button>
      <button>Bills</button>
    </nav>
  );
}
export default MainNavigation;
